            });  

    }



  return (
    <div className='container'>
        <h3>Get Single Exam by Unique ID</h3>

        {loading && <div>Loading...</div>}
        { <div style={{display:'block', color:'#fff', background: 'red'}}>{ msg}</div>}


        <form onSubmit={handleFind}>
            <label>Exam Number:
                <input type='text'
                    placeholder='Exam Number' 
                    value={examnumber}
                    onChange={(e)=>setExamnumber(e.target.value.toUpperCase())}
                 /></label>
            <button>Find</button>   
        </form>


        <div>
        <label>Exam Name: <input type='text' readOnly value={examnumber} /></label>  

